import React from "react";
import { NavLink } from "react-router-dom";

import "./NavLinks.css";

function NavLinks(props) {
  return (
    <ul className="nav-links">
      <li>
        <NavLink to="/" exact>
          Accueil
        </NavLink>
      </li>
      <li>
        <NavLink to="/cours/new">Cours</NavLink>
      </li>
      <li>
        <NavLink to="/places/new">Profs</NavLink>
      </li>
    </ul>
  );
}

export default NavLinks;
